window.bookSummaryJSON = "<p>The thrilling conclusion to the breakout Malediction Trilogy by Goodreads Choice finalist Danielle L. Jensen. </p> <p>Cécile and Tristan have accomplished the impossible, but their greatest challenge remains: defeating the evil they have unleashed upon the world. </p> <p>As they scramble for a way to protect the people of the Isle and liberate the trolls from their tyrant king, Cécile and Tristan must battle those who'd see them dead. To win, they will risk everything. And everyone. </p> <p>But it might not be enough. Both Cécile and Tristan have debts, and they will be forced to pay them at a cost far greater than they had ever imagined. </p>"; 
